Subject: [EVP-ITC] scratch

ok a little freaked here, trying to just tune this out!
There is a scratch on my arm that was not there last night/ yesterday
etc. I was sending out some emails and my arm hurt &lt;right underside&gt; and
there is  about a 3 inch scratch there. And i couldnt scratch myself in
my sleep cause i have NO nails! LOL i chew my nails &lt;TMI&gt; lol


amy eeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeek

